import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";

function Expenses(expenses) {
    return (
        <div className="expenses">
            <ExpenseItem
                date={expenses.expense.date}
                title={expenses.expense.title}
                amount={expenses.expense.amount}
            />
        </div>
    );
}

export default Expenses;
